function init(){for(var e=0;e<localStorage.length;e++){var n=localStorage.key(e);"note"===n.substring(0,6)&&addStickiesToPage(localStorage.getItem(n))}}function addStickiesToPage(e){var n=document.getElementById("note-"),t=document.createElement("li"),o=document.createElement("span");o.setAttribute("class","note"),o.innerHTML=e,t.appendChild(o),n.appendChild(t)}function showSpinner(){$(".taskHandler").show()}function hideSpinner(){$(".taskHandler").hide()}window.onload=init,$(function(){$("#timezone").select2({})});